INSERT INTO `email_template` VALUES (1,'Account Activation','<p>\r\n	Hi ${<span data-scayt_word=\"accountName\" data-scaytid=\"1\">accountName</span>}</p>\r\n<p>\r\n	Welcome to STARBOARD <span data-scayt_word=\"B2B\" data-scaytid=\"2\">B2B</span> Web site. Please keep this e-mail for your records. Your account information is as follows:</p>\r\n<p>\r\n	-------------------------------</p>\r\n<p>\r\n	URL: ${<span data-scayt_word=\"serverPath\" data-scaytid=\"9\">serverPath</span>}<br />\r\n	Username : ${username}<br />\r\n	Password : ${password}</p>\r\n<p>\r\n	------------------------------<br />\r\n	<br />\r\n	Please visit the following link in order to activate your account:<br />\r\n	${<span data-scayt_word=\"serverName\" data-scaytid=\"4\">serverName</span>}/BakCustAction.do?method=<span data-scayt_word=\"activateUser\" data-scaytid=\"6\">activateUser</span>&amp;<span data-scayt_word=\"custUserId\" data-scaytid=\"7\">custUserId</span>=${username}&amp;k=${<span data-scayt_word=\"encryptKey\" data-scaytid=\"8\">encryptKey</span>}</p>\r\n<p>\r\n	Your password has been securely stored in our database and cannot be retrieved. In the event that it is forgotten, you will be able to reset it using the email address associated with your account. Thank you for registering.</p>\r\n<p>\r\n	- The STARBOARD team</p>\r\n','null','null',NULL,NULL),(2,'Request for changing address information','<p>\r\n	Hi starboard team,</p>\r\n<p>\r\n	We request to change the company address as the following information:</p>\r\n<p>\r\n	Customer Code: ${address.custId}<br />\r\n	CustomerName: ${cust.nameEn}</p>\r\n<p>\r\n	Address Type : #if ($address.type == \'1\' ) Company Address #else Shipping Address #end<br />\r\n	Address : ${address.address}<br />\r\n	Country : ${address.regionCountryId}<br />\r\n	Post Code: ${address.postCode}<br />\r\n	Tel : ${address.tel1}<br />\r\n	Fax: ${address.fax}<br />\r\n	Email: ${address.email}</p>\r\n<p>\r\n	Sincerely,</p>\r\n<p>\r\n	${custUser.name}<br />\r\n	${cust.nameEn}</p>\r\n',NULL,NULL,NULL,NULL),(10,'Order Acknowledgement ${order.orderCode} - Wait for approve','<p>\r\n	Dear ${custUser.name}<br />\r\n	<br />\r\n	We are pleased to inform you that order ${order.orderCode} is waiting for approve. Please see the details of the detail in the STARBOARD B2B System.</p>\r\n<p>\r\n	${serverPath}/FntOrderAction.do?method=openEditOrderByCustUser&amp;orderId=${order.orderId}&amp;k=${encryptKey}</p>\r\n<p>\r\n	<br />\r\n	- The STARBOARD team</p>\r\n',NULL,NULL,NULL,NULL),(20,'Order Acknowledgement ${order.orderCode} - Revised','<p>\r\n	Dear Sir/Madam<br />\r\n	<br />\r\n	We are pleased to inform you that the order ${order.orderCode} need to be revised. Please see the details of the detail in the STARBOARD <span data-scayt_word=\"B2B\" data-scaytid=\"1\">B2B</span> System.</p>\r\n<p>\r\n	${serverPath}/FntOrderAction.do?method=openEditOrderByCustUser&amp;orderId=${order.orderId}&amp;k=${encryptKey}<br />\r\n	<br />\r\n	- The STARBOARD team</p>\r\n',NULL,NULL,NULL,NULL),(30,'Order Acknowledgement ${order.orderCode} - Approved','<p>\r\n	Dear ${custUser.name}<br />\r\n	<br />\r\n	We are pleased to inform you that order ${order.orderCode} is approved. Please see the details of the detail in the STARBOARD <span data-scayt_word=\"B2B\" data-scaytid=\"1\">B2B</span> System.<br />\r\n	<br />\r\n	${serverPath}/FntOrderAction.do?method=openEditOrderByCustUser&amp;orderId=${order.orderId}&amp;k=${encryptKey}<br />\r\n	<br />\r\n	- The STARBOARD team</p>\r\n',NULL,NULL,NULL,NULL),(40,'Order Acknowledgement ${order.orderCode} - On Production','<p>\r\n	Dear ${custUser.name}<br />\r\n	<br />\r\n	We are pleased to inform you that one or more of your items is on production process. Please see the details of the detail in the STARBOARD B2B System.</p>\r\n<p>\r\n	${serverPath}/FntOrderAction.do?method=openEditOrderByCustUser&amp;orderId=${order.orderId}&amp;k=${encryptKey}</p>\r\n<p>\r\n	<br />\r\n	- The STARBOARD team</p>\r\n',NULL,NULL,NULL,NULL),(50,'Order Acknowledgement ${order.orderCode} - Ready to Ship','<p>\r\n	Dear ${custUser.name}<br />\r\n	<br />\r\n	We are pleased to inform you that one or more of your items of order ${order.orderCode} is ready to ship. Please see the details of the detail in the STARBOARD B2B System.</p>\r\n<p>\r\n	${serverPath}/FntOrderAction.do?method=openEditOrderByCustUser&orderId=${order.orderId}&k=${encryptKey}<br />\r\n	<br />\r\n	- The STARBOARD team</p>\r\n',NULL,NULL,NULL,NULL),(60,'Order Acknowledgement ${order.orderCode} - Release','<p>\r\n	Dear ${custUser.name}<br />\r\n	<br />\r\n	We are pleased to inform you that one or more of your items has released. Please see the details of the detail in the STARBOARD <span data-scayt_word=\"B2B\" data-scaytid=\"1\">B2B</span> System.<br />\r\n	<br />\r\n	${serverPath}/FntOrderAction.do?method=openEditOrderByCustUser&amp;orderId=${order.orderId}&amp;k=${encryptKey}</p>\r\n<p>\r\n	- The STARBOARD team</p>\r\n',NULL,NULL,NULL,NULL),(70,'Order Acknowledgement ${order.orderCode} - Ship','<p>\r\n	Dear Sir/Madam<br />\r\n	<br />\r\n	We are pleased to inform you that one or more of your items of order ${order.orderCode} has shipped. Please see the details of the detail in the STARBOARD B2B System. If you ordered more than one item, they may ship separately.<br />\r\n	<br />\r\n	${serverPath}/FntOrderAction.do?method=openEditOrderByCustUser&amp;orderId=${order.orderId}&amp;k=${encryptKey}<br />\r\n	<br />\r\n	- The STARBOARD team</p>\r\n',NULL,NULL,NULL,NULL),(80,'Order Acknowledgement ${order.orderCode} - Invoice','<p>\r\n	Dear Sir/Madam<br />\r\n	<br />\r\n	We are pleased to inform you that order ${order.orderCode} is on invoice process. Please see the details of the detail in the STARBOARD <span data-scayt_word=\"B2B\" data-scaytid=\"1\">B2B</span> System.</p>\r\n<p>\r\n	${serverPath}/FntOrderAction.do?method=openEditOrderByCustUser&amp;orderId=${order.orderId}&amp;k=${encryptKey}<br />\r\n	<br />\r\n	- The STARBOARD team</p>\r\n',NULL,NULL,NULL,NULL),(90,'Order Acknowledgement ${order.orderCode} - Partial shipment','<p>\r\n	Dear Sir/Madam<br />\r\n	<br />\r\n	We are pleased to inform you that one or more of your items of order ${order.orderCode} has partial shipped. Please see the details of the detail in the STARBOARD <span data-scayt_word=\"B2B\" data-scaytid=\"1\">B2B</span> System. If you ordered more than one item, they may ship separately.<br />\r\n	<br />\r\n	${serverPath}/FntOrderAction.do?method=openEditOrderByCustUser&amp;orderId=${order.orderId}&amp;k=${encryptKey}<br />\r\n	<br />\r\n	- The STARBOARD team</p>\r\n',NULL,NULL,NULL,NULL),(100,'Order Acknowledgement ${order.orderCode} - Complete','<p>\r\n	Dear Sir/Madam<br />\r\n	<br />\r\n	We are pleased to inform you that order ${order.orderCode} has complete. Please see the details of the detail in the STARBOARD <span data-scayt_word=\"B2B\" data-scaytid=\"1\">B2B</span> System.<br />\r\n	<br />\r\n	${serverPath}/FntOrderAction.do?method=openEditOrderByCustUser&amp;orderId=${order.orderId}&amp;k=${encryptKey}<br />\r\n	<br />\r\n	- The STARBOARD team</p>\r\n',NULL,NULL,NULL,NULL);
